// 2360. Longest Cycle in a Graph
// https://leetcode.com/problems/longest-cycle-in-a-graph/
/**
 * @param {number[]} edges
 * @return {number}
 */
var longestCycle = function (edges) {
  let longest = -1;
  const n = edges.length;
  const visited = new Set();
  for (let i = 0; i < n; i++) {
    let node = edges[i];
    if (node === -1 || visited.has(node)) continue;

    const map = new Map();
    let steps = 0;
    map.set(node, steps);
    visited.add(node);

    while (edges[node] !== -1) {
      node = edges[node];
      if (map.has(node)) {
        longest = Math.max(longest, steps - map.get(node) + 1);
        break;
      }

      if (visited.has(node)) break;

      steps++;
      map.set(node, steps);
      visited.add(node);
    }
  }

  return longest;
};

